import Layout from '../../components/Layout';
import SkillSet from './skillset';
import Whoami from './whoami';
import Projects from "./projects";

const Index = () => (
    <Layout>
        <Whoami/>
        <SkillSet/>
        <Projects/>
    </Layout>
);
export default Index;
